import React from "react";
import { FaUserAlt } from 'react-icons/fa';
import { FaLock } from 'react-icons/fa';


class Login extends React.Component {
    render() {
        return(
            <div id="login">
                <h1>LOG IN</h1>
                <div>
                    <div>
                        <p>User Name</p>
                        <div className = "input">
                            <FaUserAlt/>
                            <input 
                                type="text" 
                                name = "username" 
                                onChange={this.props.handleUsernameInput}
                              
                            />
                        </div>
                    </div>
                    <div>
                        <p>Password</p>
                        <div className = "input">
                            <FaLock/>
                            <input type="password" name = "username" onChange = {this.props.handlePasswordInput}/>
                        </div>
                    </div>
                    <div id = "signin">
                        <button>
                            SIGN IN
                        </button>
                    </div>
                  
                </div>
            </div>
        );
    }
}

export default Login;
